import React from 'react';

import { Text, View, Image } from 'react-native';

function KatsItem ({preview, name}) {



	return (
		<View>
		{
				name.map((nam, index) => (
					<View>
						<Image
			              	source={{
			                width: 200,
			                height: 200,
			                uri: preview}}
			              />
			              <Text>
							{nam[index]}	
						 </Text>
						</View>
					)
					)
		}

			<View>
			</View>
		</View>

		)
}

export default KatsItem;
